- input: "TEXT\x1CC00493783\x1C.TEXT\x1C\x1CF3N\x1CThe Committee has demonstrated
    the necessary steps to establish best efforts to obtain and disclose the full
    identification of all individuals who contribute in excess of $200 in an election
    cycle. These efforts include a clear request with the original solicitation, followed
    by a Request for Missing Information Letter, which clearly asks for the missing
    information, without soliciting a contribution. In addition, the letter reads:
    Federal law requires us to make our best efforts to collect and report the name,
    mailing address, occupation and name of employer of individuals who contribute
    in excess of $200 in an election cycle. We then enclose a self-addressed envelope
    and include a telephone number to reach the committee with any questions. In the
    event that we receive additional information from contributors whose information
    was not originally disclosed, we will amend the appropriate report to reflect
    the additional disclosures properly.\n"
